import {useState, useEffect} from "react";

function MovieVideo() {
  const [movieState, setMovie] = useState([]);

  useEffect(() => {
    fetch(
      "https://api.themoviedb.org/3/movie/upcoming?api_key=131f3dc4657440aa2ed80c0a22a7d1f9&language=en-US&page=1"
    )
      .then((res) => res.json())
      .then((res) => {
        setMovie(res);
      })
      .catch((err) => {});
  }, []);
  return (
    <div>
      <h1>111</h1>
    </div>
  );
}

export default MovieVideo;
